export default function Dialog(prop) {
    return this.props.visible ? (
        <div className="modal-mask">
            <div className="modal-wrap">
                <div className="header">
                    <div className="title">确认付款</div>
                </div>
                <div className="body">
                    {prop.children}
                </div>
                <div className="footer">
                    <div className="cancel" onClick={prop.onCancel.bind(this)}>取消</div>
                    <div className="confirm" onClick={prop.onConfirm.bind(this)}>确定</div>
                </div>
            </div>
        </div>
    ) : (<span/>)

};
